import React from 'react'

class LeaderboardView extends React.Component{

    state = { leaderboardName : "Leaderboard1", leaderboardEntries :[] }

    render(){
        return(
            <div>
                <h1>Leaderboard</h1> : {this.state.leaderboardName} <br></br>
                <h1>LeaderboardEntries</h1> :
                <div>
                    {this.state.leaderboardEntries.map(( leaderboard )=> {
                        return <h1>{leaderboard}</h1>
                    })}

                </div>
            </div>
        )
    }
}

export default LeaderboardView;
